import React from 'react'

function Register() {
 const [formData,setFormData]=useState({
  name:'',
  email:'',
  password:'',
  password2:'',
 })

 const{name,email,password,password2}=formData

 const onChange=(e)=>{
 setFormData((prev)=>({}))
 }
  return (
    <>
      <section>
        <h1>registration </h1>
        <p>please register yourself</p>
      </section>
      {/* form section */}
      <form>
        <input
          type='text'
          id='name'
          name='name'
          value={name}
          placeholder='enter your name'
          onChange={onChange}
        />

        <input
          type='email'
          id='email'
          name='email'
          value={email}
          placeholder='enter your email'
          onChange={onChange}
        />
        <input
          type='password'
          id='password'
          name='password'
          value={password}
          placeholder='password'
          onChange={onChange}
        />

        <input
          type='password'
          id='password2'
          name='password2'
          value={password2}
          placeholder='confirm password'
          onChange={onChange}
        />
      </form>
    </>
  );
}

export default Register
